async function main() {
  await prisma.album.createMany({
    data: albums.map(album => ({
      id: album._id,
      score: album.score,
      album_clean: album.album_clean,
      artist_clean: album.artist_clean,
      genres: album.genres,
      year: String(album.year),
      vref: album.vref || '',
      cover_url: album.cover_url,
    })),
    skipDuplicates: true,
  })
}

main()
  .then(async () => {
    await prisma.$disconnect()
  })
  .catch(async (e) => {
    console.error(e)
    await prisma.$disconnect()
    process.exit(1)
  })